class WpextendedLimitLoginAttempts{constructor(){this.init()}init(){this.registerFormatters()}registerFormatters(){window.blockedAccountsActionsFormatter=(t,n)=>{const s=n.cells[0]?.data,e=n.cells[4]?.data;if(!s)return gridjs.html(`<span class="text-muted">${this.getTranslation("noId")}</span>`);if(!e)return gridjs.html(`<span class="text-muted">${this.getTranslation("alreadyUnblocked")}</span>`);const a=this.createUnblockUrl(s);return gridjs.html(`\n        <a href="${a}"\n           class="wpext-link wpext-link--unblock"\n           data-allow-default="true"\n           onclick="handleUnblockClick(event)">\n          <span class="dashicons dashicons-unlock"></span> Unblock\n        </a>\n      `)},window.blockedAccountsStatusFormatter=(t,n)=>{const s=n.cells[4]?.data,e=n.cells[5]?.data||0;if(1===s){const t=`${Math.floor(e/60)}:${(""+e%60).padStart(2,"0")}`;return gridjs.html(`\n          <span class="wpext-status wpext-status--blocked" title="Blocked - ${t} remaining">\n            <span class="dashicons dashicons-lock"></span> Blocked\n          </span>\n        `)}return gridjs.html('\n          <span class="wpext-status wpext-status--unblocked">\n            <span class="dashicons dashicons-unlock"></span> Unblocked\n          </span>\n        ')}}createUnblockUrl(t){return`${wpextLoginAttempts.actionUrl}&account_id=${t}`}getTranslation(t){return"undefined"!=typeof wpextLoginAttempts&&wpextLoginAttempts.i18n&&wpextLoginAttempts.i18n[t]?wpextLoginAttempts.i18n[t]:t}}document.addEventListener("DOMContentLoaded",(()=>{new WpextendedLimitLoginAttempts}));